import React from 'react'
import Header from './components/Header';
import Balance from './components/Balance';
import IncomeExpense from './components/IncomeExpense';

import './App.css';

function App() {
  return (
    <div>
      <Header />
      <div className='container'>
        <Balance />
      </div>
      <div className=''>
        <IncomeExpense />
      </div>
    </div>
  );
}

export default App;
